import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div>
     <BrowserRouter>
     <Routes>
      <Route />
     </Routes>
     </BrowserRouter>
    </div>
  );
}

export default App;
